import React from 'react';

function Music() {
  let audio = new Audio("src/resources/02 Snoop Dogg - Gin & Juice.mp3")

  const start = () => {
    audio.play();
  }

  return (
    <audio controls autoPlay>
      <button onClick={start}>Play</button>
    </audio>
  );
}

export default Music;
